package com.cleiton.cursojava.aula16e17exercicios;

public class Exe09NumerosImpares0A150 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int numero = 0;
		
		while (numero <= 150) {
			
			if (numero % 2 ==1) {
				System.out.println(numero + " Impar");
			}
			numero ++;
		}

	}

}
